import { useEffect, useState } from "react";
import AOS from "aos";
import { Trainers, Staff } from "./Trainers"

const StaffOTrainers = (element) => {


    const [staff, setStaff] = useState([])


    useEffect(() => {
        AOS.init(
        );

        if (element.type == "trainer") {
            setStaff(Trainers)
        } else {
            setStaff([
                {
                    id: 1,
                    firstName: 'ZIYAD',
                    lastName: 'Ashour',
                    age: '30',
                    bio: '',
                    photo: 'https://picsum.photos/id/1018/250/150/'

                },
                {
                    id: 2,
                    firstName: 'OMAR',
                    lastName: 'Attia',
                    age: '22',
                    bio: '',
                    photo: 'https://picsum.photos/id/1018/250/150/'

                },
                {
                    id: 3,
                    firstName: 'ZEAD',
                    lastName: 'Zooz',
                    age: '22',
                    bio: '',
                    photo: 'https://picsum.photos/id/1018/250/150/'

                },


            ]
            )
        }

    }, []);





    return (
        <div className="trainers" data-aos="fade-up">
            {
                staff.map((employer) => (

                    <div className="trainer" key={employer.id}>
                        <img className={element.ppClass} src={employer.photo} />
                        <div className={element.nameClass}>{employer.firstName}</div>
                        {element.specialization &&
                            <div class={element.specialization}>{employer.specialization}</div>
                        }
                    </div>

                )
                )
            }
        </div>
    )


}

export default StaffOTrainers
